import React from 'react';
import './App.css';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';

const App = () => {
  return (
    <div className="App">
      <div className="column">

        <Swiper direction="vertical" className="swiper">
          <SwiperSlide className="square">Media Content 1</SwiperSlide>
          <SwiperSlide className="square">Media Content 2</SwiperSlide>
          <SwiperSlide className="square">Media Content 3</SwiperSlide>
        </Swiper>
      </div>
      <div className="column">
        <Swiper direction="vertical" className="swiper">
          <SwiperSlide className="square">Media Content 4</SwiperSlide>
          <SwiperSlide className="square">Media Content 5</SwiperSlide>
          <SwiperSlide className="square">Media Content 6</SwiperSlide>
        </Swiper>
      </div>
    </div>
  );
};

export default App;
